import React, { Component } from 'react';
import { Route, Router } from 'react-router';

import Navbar from './components/Navbar';

import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

class App extends Component {

  render() {

    return (

      <div className="App">
        <Navbar />
        <Router>
          <Route></Route>
        </Router>
      </div>
    );
  }
}

export default App;
